import React from 'react';

import './footer.scss';

import { Link } from 'react-router-dom';

import bg from '../../assets/footer-bg.jpg';
import logo from '../../assets/Moviez-removebg-preview.png';

const Footer = () => {
    return (
        <div className="footer" style={{backgroundImage: `url(${bg})`}}>
            <div className="footer__content container">
                <div className="footer__content__logo">
                    <div className="logo">
                    <Link to="/"><img src={logo} alt="" style={{width: 500}} /></Link>
                    </div>
                </div>
                <div className="footer__content__menus">
                    <div className="footer__content__menu">
                        <Link to="/">Home</Link>
                    </div>
                    <div className="footer__content__menu">
                        <Link to="/about">About</Link>
                    </div>
                    <div className="footer__content__menu">
                        <Link to="/contact">Contact Us</Link>
                    </div>
                </div>
                <div className="footer__content__menu" style={{ alignItems: 'center' }}>
                    <Link to="/webcollection"> &copy; Web Collections </Link>
                 </div>
            </div>
        </div>
    );
}

export default Footer;
